const filterData = (dataset, key, value) => {
    let temp = []
    for (let i = 0; i < value.length; i++) {
        for (let j = 0; j < dataset.length; j++) {
            if (dataset[j][key] == (value[i])) {
                temp.push(dataset[j])
            }
        }
    }
    return temp
}

// Formats into chartsjs style data
const formatData = (dataset) => {
    let National_Public = formatChartJsObject(`National Public`, `rgb(2, 15, 163)`)
    let National_Private = formatChartJsObject(`National Private`, `rgb(189, 85, 6)`)
    let Non_National_Public = formatChartJsObject(`Non-National Public`, `rgb(73, 183, 230)`)
    let Non_National_Private = formatChartJsObject(`Non-National Private`, `rgb(255, 193, 99)`)
    for (let i = 0; i < dataset.length; i++) {
        dataset[i].y = dataset[i][axes.y]
        dataset[i].x = dataset[i][axes.x]
        dataset[i].selected = true
        if (dataset[i]["nationalu"] == 1 && dataset[i]["pubpriv"] == 1) {
            National_Public["data"].push(dataset[i])
        } else if (dataset[i]["nationalu"] == 0 && dataset[i]["pubpriv"] == 1) {
            Non_National_Public["data"].push(dataset[i])
        } else if (dataset[i]["nationalu"] == 1 && dataset[i]["pubpriv"] == 2) {
            National_Private["data"].push(dataset[i])
        } else if (dataset[i]["nationalu"] == 0 && dataset[i]["pubpriv"] == 2) {
            Non_National_Private["data"].push(dataset[i])
        }
    }

    // Filters out empty categories
    let groups = [National_Public, Non_National_Public, National_Private, Non_National_Private]
    let final = []
    for (let i = 0; i < groups.length; i++) {
        if (groups[i]["data"].length > 0) {
            final.push(groups[i])
        }
    }
    return groups
}

