// Closes open menus when clicked elsewhere on screen
window.addEventListener('mousedown', e => {
    // Certain classes (Safe Classes) are whitelisted, and won't cause menu to close when targeted
    for (let i = 0; i < SAFE_CLASSES.length; i++) {
        if (event.target.matches(SAFE_CLASSES[i])) {
            return
        }
    }
    var dropdowns = document.getElementsByClassName("filter_list");
    var j;
    for (j = 0; j < dropdowns.length; j++) {
        var openDropdown = dropdowns[j];
        if (openDropdown.classList.contains('showList')) {
            openDropdown.classList.remove('showList');
        }
    }

});


function filterUni() {
    var input, filter, table, tr, td, i, txtValue;
    input = document.getElementById("myInput");
    filter = input.value.toUpperCase();
    table = document.getElementById("uniTable");
    tr = table.getElementsByTagName("tr");
    for (i = 0; i < tr.length; i++) {
        td = tr[i].getElementsByClassName("universityName")[0];
        if (td) {
            txtValue = td.textContent || td.innerText;
            if (txtValue.toUpperCase().indexOf(filter) > -1) {
                tr[i].style.display = "";
            } else {
                tr[i].style.display = "none";
            }
        }
    }
}

// Makes a point big when hovering over table element
const hBig = (set, idx) => {
    idx = findIndex(set, idx)
    if (idx >= 0) {
        let meta = scatterChart.getDatasetMeta(set)
        let rect = scatterChart.canvas.getBoundingClientRect()
        let point = meta.data[idx].getCenterPoint()
        let evt = new MouseEvent('mousemove', {
            clientX: rect.left + point.x,
            clientY: rect.top + point.y
        })
        let node = scatterChart.canvas
        node.dispatchEvent(evt)
    }
}

const findIndex = (set, idx) => {
    let data = scatterChart.data.datasets[set]["data"]
    for (let i = 0; i < data.length; i++) {
        if (data[i]["UNITID"] == idx) {
            return i
        }
    }
    return -1

}

